@RonnieColeman-ti7gy We're not talking about small problems. Yes USA has problems, but Qatar used literal slave labor to build their stadiums, gays can be legally hanged and women have almost zero rights there. It's a form of sportwashing to portray Qatari Dictatorship in a positive light. 

Now I am not saying that It shouldn't have taken place in Qatar, but you can see the criticism of many people. Fifa has a history of organizing World Cups in dictatorships. One was organized in Fascist Italy, in 1978 it was organized in Argentina which was under military dictatorship which killed people during the tournament. 

Not to mention that the US prosecutors uncovered a proven bribery by Qatari officials to Fifa to host the World Cup. It was rigged, and Sep Blatter was banned from football.
